import React from 'react';

import './CalculatorSummary.css';

const calculatorSummary = (props) => {
    return (
        <div>
            <center><h1>Summary for the month {props.workedMonthName}</h1>
                <br></br>
                Time dimension on this date: <b>{props.workingHoursInMonth}h</b>, working hours: <b>{props.workedHours}h</b><br></br>
                Hourly rate (gross): <b>{props.hourlyFee}zł</b><br></br>
                Number of overtime hours: <b>{props.overHoursAmount}</b>, gross salary: <b>{props.overHoursGrossIncome}zł</b><br></br>
                Number of overtime hours: <b>{props.overHoursAmount}</b>, net salary: <b>{props.overHoursNetIncome}zł</b><br></br>
                Total gross salary (base + overhours): <b>{props.totalGrossIncome}zł</b><br></br>
                Total net salary (base + overhours): <b>{props.totalNetIncome}zł</b><br></br>
            </center>
        </div>
    );
}

export default calculatorSummary;
